// ============================================================
// PARTICLE CANVAS
// ============================================================
function ParticleField({ intensity = 1 }) {
  const canvasRef = useRef(null);
  useEffect(() => {
    const canvas = canvasRef.current;
    const ctx = canvas.getContext("2d");
    let W = canvas.width = canvas.offsetWidth;
    let H = canvas.height = canvas.offsetHeight;
    const count = Math.floor(100 * intensity);
    const particles = Array.from({ length: count }, () => ({
      x: Math.random() * W, y: Math.random() * H + H * 0.4,
      vx: (Math.random() - 0.5) * 0.5, vy: -Math.random() * 1.0 - 0.2,
      size: Math.random() * 2 + 0.4,
      alpha: Math.random() * 0.6 + 0.1,
      color: [`#d4a853`, `#e8832a`, `#c0392b`, `#9b59b6`, `#3498db`, `#f39c12`][Math.floor(Math.random() * 6)],
      life: Math.random(),
    }));
    let raf;
    const draw = () => {
      ctx.clearRect(0, 0, W, H);
      particles.forEach(p => {
        p.x += p.vx + Math.sin(p.life * 3) * 0.3;
        p.y += p.vy;
        p.life += 0.004;
        p.alpha = Math.sin(p.life * Math.PI) * 0.7;
        if (p.y < -10 || p.life > 1) {
          p.y = H + 10; p.x = Math.random() * W;
          p.vx = (Math.random() - 0.5) * 0.5; p.vy = -Math.random() * 1.0 - 0.2;
          p.life = 0;
        }
        ctx.save();
        ctx.globalAlpha = Math.max(0, p.alpha);
        ctx.fillStyle = p.color;
        ctx.shadowBlur = 10; ctx.shadowColor = p.color;
        ctx.beginPath(); ctx.arc(p.x, p.y, p.size, 0, Math.PI * 2); ctx.fill();
        ctx.restore();
      });
      raf = requestAnimationFrame(draw);
    };
    draw();
    const resize = () => { W = canvas.width = canvas.offsetWidth; H = canvas.height = canvas.offsetHeight; };
    window.addEventListener("resize", resize);
    return () => { cancelAnimationFrame(raf); window.removeEventListener("resize", resize); };
  }, [intensity]);
  return <canvas ref={canvasRef} style={{ position: "fixed", inset: 0, width: "100%", height: "100%", pointerEvents: "none", zIndex: 0 }} />;
}

// ============================================================
// TURN SPENDING EFFECT - Full-screen cinematic overlay
// ============================================================
function TurnEffect({ effect, onComplete }) {
  const [phase, setPhase] = useState(0);
  useEffect(() => {
    if (!effect) return;
    setPhase(1);
    const t1 = setTimeout(() => setPhase(2), 400);
    const t2 = setTimeout(() => setPhase(3), 1200);
    const t3 = setTimeout(() => { setPhase(0); onComplete?.(); }, 1800);
    return () => { clearTimeout(t1); clearTimeout(t2); clearTimeout(t3); };
  }, [effect]);

  if (!effect || phase === 0) return null;

  const configs = {
    explore: { icon: "", color: "#3498db", text: "Scouts deployed!", sub: "Charting unknown territories...", particles: "" },
    tax: { icon: "", color: "#f1c40f", text: "Taxes collected!", sub: "Gold flows into the treasury...", particles: "" },
    farm: { icon: "", color: "#27ae60", text: "Harvest complete!", sub: "Fields yield their bounty...", particles: "" },
    attack: { icon: "", color: "#e74c3c", text: "Armies march!", sub: "Steel meets steel...", particles: "" },
    victory: { icon: "", color: "#d4a853", text: "VICTORY!", sub: "The enemy is crushed!", particles: "" },
    defeat: { icon: "", color: "#c0392b", text: "DEFEAT!", sub: "Your forces are repelled...", particles: "" },
    spell: { icon: "", color: "#9b59b6", text: "Spell cast!", sub: "Arcane energies surge...", particles: "" },
    build: { icon: "", color: "#e67e22", text: "Construction complete!", sub: "Workers labor day and night...", particles: "" },
    recruit: { icon: "", color: "#e74c3c", text: "Forces enlisted!", sub: "New soldiers join your ranks...", particles: "" },
  };

  const cfg = configs[effect.type] || configs.explore;

  return (
    <div style={{
      position: "fixed", inset: 0, zIndex: 9998, pointerEvents: "none",
      display: "flex", alignItems: "center", justifyContent: "center",
      overflow: "hidden",
    }}>
      {/* Radial burst background */}
      <div style={{
        position: "absolute", inset: 0,
        background: `radial-gradient(ellipse at center, ${cfg.color}33 0%, ${cfg.color}11 40%, transparent 70%)`,
        opacity: phase === 1 ? 0 : phase === 2 ? 1 : 0,
        transition: "opacity 0.4s ease",
      }} />

      {/* Horizontal scan lines */}
      {phase === 2 && [0, 1, 2].map(i => (
        <div key={i} style={{
          position: "absolute", left: 0, right: 0,
          top: `${20 + i * 30}%`, height: 1,
          background: `linear-gradient(90deg, transparent, ${cfg.color}66, ${cfg.color}aa, ${cfg.color}66, transparent)`,
          animation: `scanLine 0.8s ease-out ${i * 0.1}s`,
        }} />
      ))}

      {/* Central content */}
      <div style={{
        textAlign: "center", position: "relative", zIndex: 1,
        opacity: phase === 2 ? 1 : 0,
        transform: phase === 2 ? "scale(1) translateY(0)" : "scale(0.7) translateY(30px)",
        transition: "all 0.4s cubic-bezier(0.23, 1, 0.32, 1)",
      }}>
        {/* Floating particles */}
        {phase === 2 && Array.from({ length: 12 }).map((_, i) => (
          <div key={i} style={{
            position: "absolute",
            left: "50%", top: "50%",
            color: cfg.color,
            fontSize: Math.random() * 16 + 8,
            animation: `floatParticle${i % 4} 1.4s ease-out`,
            opacity: 0,
          }}>{cfg.particles}</div>
        ))}

        <div style={{
          fontSize: 72, marginBottom: 12,
          filter: `drop-shadow(0 0 30px ${cfg.color}) drop-shadow(0 0 60px ${cfg.color}88)`,
          animation: "iconPop 0.5s cubic-bezier(0.23, 1, 0.32, 1)",
        }}>{cfg.icon}</div>
        
        <div style={{
          fontFamily: "'Cinzel', serif", fontSize: "clamp(22px, 4vw, 36px)",
          color: cfg.color, letterSpacing: 4, textTransform: "uppercase",
          textShadow: `0 0 30px ${cfg.color}, 0 0 60px ${cfg.color}88`,
          marginBottom: 8,
        }}>{effect.title || cfg.text}</div>
        
        <div style={{
          color: "#aaa", fontSize: 14, letterSpacing: 2, fontStyle: "italic",
        }}>{effect.sub || cfg.sub}</div>

        {/* Resource gain indicator */}
        {effect.gain && (
          <div style={{
            marginTop: 16, padding: "8px 24px",
            background: `${cfg.color}22`, border: `1px solid ${cfg.color}55`,
            borderRadius: 20, display: "inline-block",
            fontFamily: "'Cinzel', serif", fontSize: 18,
            color: "#fff", textShadow: `0 0 10px ${cfg.color}`,
            animation: "gainPop 0.6s ease 0.2s both",
          }}>{effect.gain}</div>
        )}
      </div>
    </div>
  );
}

// ============================================================
// TORCH
// ============================================================
function Torch({ side = "left" }) {
  const canvasRef = useRef(null);

  useEffect(() => {
    const canvas = canvasRef.current;
    const ctx = canvas.getContext("2d");
    const W = canvas.width = 80;
    const H = canvas.height = 180;

    // Flame particles
    const particles = [];
    const PARTICLE_COUNT = 38;

    class FlameParticle {
      constructor() { this.reset(true); }
      reset(born = false) {
        // spawn near the torch head center
        this.x = W / 2 + (Math.random() - 0.5) * 10;
        this.y = born ? H * 0.38 + Math.random() * 20 : H * 0.38 + Math.random() * 8;
        this.vx = (Math.random() - 0.5) * 0.7;
        this.vy = -(Math.random() * 2.2 + 1.0);
        this.life = 0;
        this.maxLife = Math.random() * 0.6 + 0.4;
        this.size = Math.random() * 9 + 4;
        this.turbulence = (Math.random() - 0.5) * 0.08;
        this.wobble = Math.random() * Math.PI * 2;
        this.wobbleSpeed = Math.random() * 0.12 + 0.05;
      }
      update() {
        this.life += 0.018;
        this.wobble += this.wobbleSpeed;
        this.vx += this.turbulence + Math.sin(this.wobble) * 0.06;
        this.vx *= 0.97;
        this.x += this.vx;
        this.y += this.vy;
        this.vy -= 0.015; // accelerate upward
        this.size *= 0.985;
        if (this.life >= this.maxLife) this.reset();
      }
      draw() {
        const t = this.life / this.maxLife;
        // Color: white core  yellow  orange  red  transparent
        let r, g, b, a;
        if (t < 0.15) {
          // Hot white-yellow core
          r = 255; g = 255; b = Math.floor(200 * (1 - t / 0.15));
          a = t / 0.15;
        } else if (t < 0.4) {
          const p = (t - 0.15) / 0.25;
          r = 255; g = Math.floor(255 - p * 85); b = 0;
          a = 1;
        } else if (t < 0.7) {
          const p = (t - 0.4) / 0.3;
          r = 255; g = Math.floor(170 - p * 80); b = 0;
          a = 1 - p * 0.2;
        } else {
          const p = (t - 0.7) / 0.3;
          r = Math.floor(255 - p * 100); g = Math.floor(90 - p * 90); b = 0;
          a = (1 - p) * 0.6;
        }

        const grad = ctx.createRadialGradient(this.x, this.y, 0, this.x, this.y, this.size);
        grad.addColorStop(0, `rgba(${r},${g},${b},${a})`);
        grad.addColorStop(0.5, `rgba(${r},${Math.floor(g * 0.7)},0,${a * 0.5})`);
        grad.addColorStop(1, `rgba(${r},0,0,0)`);

        ctx.beginPath();
        ctx.fillStyle = grad;
        ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
        ctx.fill();
      }
    }

    // Embers
    const embers = Array.from({ length: 10 }, () => ({
      x: W / 2 + (Math.random() - 0.5) * 12,
      y: H * 0.38,
      vx: (Math.random() - 0.5) * 1.5,
      vy: -(Math.random() * 3 + 1),
      life: Math.random(),
      size: Math.random() * 1.8 + 0.5,
    }));

    for (let i = 0; i < PARTICLE_COUNT; i++) {
      particles.push(new FlameParticle());
    }

    let frame = 0;
    let raf;

    const drawTorchBody = () => {
      // === WALL BRACKET (metal) ===
      const bx = side === "left" ? W * 0.75 : W * 0.25;
      // bracket arm
      ctx.save();
      const bracketGrad = ctx.createLinearGradient(bx - 8, 0, bx + 8, 0);
      bracketGrad.addColorStop(0, "#2a2218");
      bracketGrad.addColorStop(0.4, "#5a4830");
      bracketGrad.addColorStop(1, "#1a1410");
      ctx.fillStyle = bracketGrad;
      ctx.beginPath();
      ctx.roundRect(bx - 5, H * 0.45, 10, 12, 2);
      ctx.fill();
      // wall screw
      ctx.fillStyle = "#3a2e1e";
      ctx.beginPath();
      ctx.arc(bx, H * 0.48, 3, 0, Math.PI * 2);
      ctx.fill();
      ctx.restore();

      // === WOODEN SHAFT ===
      const shaftX = W / 2;
      const shaftTop = H * 0.46;
      const shaftBot = H * 0.97;
      const shaftW = 7;

      // Wood gradient with grain
      const woodGrad = ctx.createLinearGradient(shaftX - shaftW, 0, shaftX + shaftW, 0);
      woodGrad.addColorStop(0, "#1e0f06");
      woodGrad.addColorStop(0.2, "#4a2510");
      woodGrad.addColorStop(0.5, "#6b3a18");
      woodGrad.addColorStop(0.75, "#4a2510");
      woodGrad.addColorStop(1, "#1e0f06");

      ctx.beginPath();
      ctx.moveTo(shaftX - shaftW / 2, shaftTop);
      ctx.lineTo(shaftX + shaftW / 2, shaftTop);
      ctx.lineTo(shaftX + shaftW / 2 - 1, shaftBot);
      ctx.lineTo(shaftX - shaftW / 2 + 1, shaftBot);
      ctx.closePath();
      ctx.fillStyle = woodGrad;
      ctx.fill();

      // Wood grain lines
      ctx.save();
      ctx.globalAlpha = 0.18;
      ctx.strokeStyle = "#1a0a02";
      ctx.lineWidth = 0.7;
      for (let i = 0; i < 6; i++) {
        const gx = shaftX - 2 + i * 1.2;
        ctx.beginPath();
        ctx.moveTo(gx, shaftTop + 4);
        ctx.bezierCurveTo(gx + 1, shaftTop + 20, gx - 1, shaftTop + 40, gx + 0.5, shaftBot - 5);
        ctx.stroke();
      }
      ctx.restore();

      // Metal ring around shaft
      const ringGrad = ctx.createLinearGradient(shaftX - 6, 0, shaftX + 6, 0);
      ringGrad.addColorStop(0, "#1a1510");
      ringGrad.addColorStop(0.3, "#6a5a3a");
      ringGrad.addColorStop(0.6, "#8a7a4a");
      ringGrad.addColorStop(1, "#2a2015");
      ctx.fillStyle = ringGrad;
      ctx.beginPath();
      ctx.roundRect(shaftX - 5, shaftTop + 14, 10, 5, 1);
      ctx.fill();

      // === TORCH HEAD (wrapped rags/pitch) ===
      const headCX = W / 2;
      const headCY = H * 0.41;
      const headRX = 11;
      const headRY = 8;

      // Dark charred exterior
      const headGrad = ctx.createRadialGradient(headCX - 2, headCY - 2, 1, headCX, headCY, headRX * 1.4);
      headGrad.addColorStop(0, "#3a2010");
      headGrad.addColorStop(0.5, "#1e0f06");
      headGrad.addColorStop(1, "#0a0602");
      ctx.beginPath();
      ctx.ellipse(headCX, headCY, headRX, headRY, 0, 0, Math.PI * 2);
      ctx.fillStyle = headGrad;
      ctx.fill();

      // Glowing ember core on top of head
      const emberGrad = ctx.createRadialGradient(headCX, headCY - 2, 0, headCX, headCY, headRX);
      emberGrad.addColorStop(0, "rgba(255,140,20,0.35)");
      emberGrad.addColorStop(0.5, "rgba(255,60,0,0.15)");
      emberGrad.addColorStop(1, "rgba(0,0,0,0)");
      ctx.beginPath();
      ctx.ellipse(headCX, headCY, headRX, headRY, 0, 0, Math.PI * 2);
      ctx.fillStyle = emberGrad;
      ctx.fill();

      // Rag wrapping texture lines
      ctx.save();
      ctx.globalAlpha = 0.3;
      ctx.strokeStyle = "#5a3010";
      ctx.lineWidth = 1;
      for (let i = -1; i <= 1; i++) {
        ctx.beginPath();
        ctx.ellipse(headCX, headCY + i * 3, headRX - 1, headRY * 0.4, 0, 0, Math.PI * 2);
        ctx.stroke();
      }
      ctx.restore();
    };

    const drawGlow = () => {
      // Large ambient light bloom around flame
      const flicker = 0.85 + Math.sin(frame * 0.08) * 0.1 + Math.sin(frame * 0.13) * 0.05;
      const cx = W / 2;
      const cy = H * 0.32;

      // Outer warm ambient
      const outerGlow = ctx.createRadialGradient(cx, cy, 0, cx, cy, 55 * flicker);
      outerGlow.addColorStop(0, "rgba(255,120,20,0.18)");
      outerGlow.addColorStop(0.4, "rgba(255,80,10,0.08)");
      outerGlow.addColorStop(1, "rgba(0,0,0,0)");
      ctx.beginPath();
      ctx.arc(cx, cy, 55 * flicker, 0, Math.PI * 2);
      ctx.fillStyle = outerGlow;
      ctx.fill();

      // Inner hot bloom
      const innerGlow = ctx.createRadialGradient(cx, cy + 4, 0, cx, cy + 4, 22 * flicker);
      innerGlow.addColorStop(0, `rgba(255,220,120,${0.55 * flicker})`);
      innerGlow.addColorStop(0.3, `rgba(255,140,20,${0.25 * flicker})`);
      innerGlow.addColorStop(1, "rgba(0,0,0,0)");
      ctx.beginPath();
      ctx.arc(cx, cy + 4, 22 * flicker, 0, Math.PI * 2);
      ctx.fillStyle = innerGlow;
      ctx.fill();
    };

    const drawEmbers = () => {
      embers.forEach(e => {
        e.x += e.vx + Math.sin(frame * 0.07 + e.life) * 0.3;
        e.y += e.vy;
        e.vy += 0.02; // gravity
        e.vx *= 0.99;
        e.life += 0.012;
        if (e.y < H * 0.05 || e.life > 1) {
          e.x = W / 2 + (Math.random() - 0.5) * 12;
          e.y = H * 0.38;
          e.vx = (Math.random() - 0.5) * 1.5;
          e.vy = -(Math.random() * 2.5 + 0.8);
          e.life = 0;
          e.size = Math.random() * 1.8 + 0.5;
        }
        const alpha = Math.sin(e.life * Math.PI) * 0.9;
        ctx.save();
        ctx.globalAlpha = alpha;
        ctx.fillStyle = e.life < 0.5 ? "#ffcc44" : "#ff6600";
        ctx.shadowBlur = 6;
        ctx.shadowColor = "#ff8800";
        ctx.beginPath();
        ctx.arc(e.x, e.y, e.size, 0, Math.PI * 2);
        ctx.fill();
        ctx.restore();
      });
    };

    const render = () => {
      ctx.clearRect(0, 0, W, H);
      frame++;

      // Glow behind everything
      drawGlow();
      // Torch body (wood + head)
      drawTorchBody();
      // Flame particles on top
      ctx.save();
      ctx.globalCompositeOperation = "screen";
      particles.forEach(p => { p.update(); p.draw(); });
      ctx.restore();
      // Embers on top
      drawEmbers();

      raf = requestAnimationFrame(render);
    };

    render();
    return () => cancelAnimationFrame(raf);
  }, [side]);

  return (
    <div style={{
      position: "fixed",
      top: "8%",
      [side]: side === "left" ? -4 : -4,
      zIndex: 2,
      pointerEvents: "none",
    }}>
      <canvas
        ref={canvasRef}
        style={{
          display: "block",
          filter: "blur(0.3px)",
        }}
      />
    </div>
  );
}

