// GAME SCREEN
// ============================================================
function GameScreen({ empire, onUpdate }) {
  const [activeTab, setActiveTab] = useState("overview");
  const [toasts, setToasts] = useState([]);
  const [turnsToUse, setTurnsToUse] = useState(5);
  const [recruitAmounts, setRecruitAmounts] = useState({});
  const [buildAmounts, setBuildAmounts] = useState({});
  const [attackTarget, setAttackTarget] = useState(LEADERBOARD[2]);
  const [flashColor, setFlashColor] = useState(null);
  const [shaking, setShaking] = useState(false);
  const [turnEffect, setTurnEffect] = useState(null);

  const addToast = useCallback((message, type = "success") => {
    const id = Date.now();
    setToasts(t => [...t, { id, message, type }]);
    setTimeout(() => setToasts(t => t.filter(x => x.id !== id)), 4000);
  }, []);

  const flash = useCallback((color, shake = false) => {
    setFlashColor(color);
    if (shake) { setShaking(true); setTimeout(() => setShaking(false), 500); }
    setTimeout(() => setFlashColor(null), 700);
  }, []);

  const showTurnEffect = useCallback((type, title, sub, gain) => {
    setTurnEffect({ type, title, sub, gain });
  }, []);

  const addLog = useCallback((text) => {
    onUpdate(prev => ({ ...prev, log: [{ text, time: new Date().toLocaleTimeString() }, ...prev.log].slice(0, 50) }));
  }, [onUpdate]);

  // --- ACTIONS ---
  const doExplore = () => {
    if (empire.turns < turnsToUse) { addToast(" Not enough turns!", "error"); return; }
    const cost = turnsToUse * 750;
    if (empire.gold < cost) { addToast(" Not enough gold!", "error"); return; }
    const gained = Math.floor(turnsToUse * (3 + Math.random() * 4));
    onUpdate(prev => ({ ...prev, turns: prev.turns - turnsToUse, gold: prev.gold - cost, land: prev.land + gained, networth: prev.networth + gained * 200 }));
    showTurnEffect("explore", "Scouts Return!", "New lands have been charted for the crown.", `+${gained} acres discovered`);
    addLog(` Explored ${gained} acres of new territory.`);
    flash("#3498db");
  };

  const doFarm = () => {
    if (empire.turns < turnsToUse) { addToast(" Not enough turns!", "error"); return; }
    const gained = Math.floor(turnsToUse * empire.buildings.food * 120);
    onUpdate(prev => ({ ...prev, turns: prev.turns - turnsToUse, food: prev.food + gained }));
    showTurnEffect("farm", "Bountiful Harvest!", "The granaries overflow with your abundance.", `+${gained.toLocaleString()} food`);
    addLog(` Harvested ${gained.toLocaleString()} food from the fields.`);
    flash("#27ae60");
  };

  const doCollectTax = () => {
    if (empire.turns < turnsToUse) { addToast(" Not enough turns!", "error"); return; }
    const gained = Math.floor(turnsToUse * empire.buildings.cash * 850);
    onUpdate(prev => ({ ...prev, turns: prev.turns - turnsToUse, gold: prev.gold + gained, networth: prev.networth + gained }));
    showTurnEffect("tax", "Coffers Filled!", "Tax collectors return with heavy purses.", `+${gained.toLocaleString()} gold`);
    addLog(` Tax collectors returned with ${gained.toLocaleString()} gold.`);
    flash("#f1c40f");
  };

  const doBuild = (bldg) => {
    const amt = parseInt(buildAmounts[bldg.id] || 1);
    const cost = amt * 1200;
    const totalBuilt = Object.values(empire.buildings).reduce((a, b) => a + b, 0);
    if (empire.gold < cost) { addToast(" Insufficient gold!", "error"); return; }
    if (totalBuilt + amt > empire.land) { addToast(" Not enough land!", "error"); return; }
    onUpdate(prev => ({ ...prev, gold: prev.gold - cost, buildings: { ...prev.buildings, [bldg.id]: prev.buildings[bldg.id] + amt }, networth: prev.networth + amt * 800 }));
    showTurnEffect("build", "Construction Complete!", `${amt} ${bldg.name} rise from the earth.`, `-${cost.toLocaleString()} gold`);
    addLog(` Constructed ${amt}x ${bldg.name}.`);
    flash("#e67e22");
  };

  const doRecruit = (unit) => {
    const amt = parseInt(recruitAmounts[unit.id] || 1);
    const cost = amt * unit.cost;
    if (empire.gold < cost) { addToast(" Insufficient gold!", "error"); return; }
    onUpdate(prev => ({ ...prev, gold: prev.gold - cost, military: { ...prev.military, [unit.id]: prev.military[unit.id] + amt }, networth: prev.networth + amt * unit.cost * 0.5 }));
    showTurnEffect("recruit", "Forces Enlisted!", `${amt} ${unit.name} join your ranks.`, `-${cost.toLocaleString()} gold`);
    addLog(` Enlisted ${amt}x ${unit.name}.`);
    flash("#e74c3c");
  };

  const doAttack = () => {
    if (!attackTarget) return;
    if (empire.turns < 5) { addToast(" Need at least 5 turns!", "error"); return; }
    const myPower = empire.military.arm * 1 + empire.military.lnd * 2 + empire.military.fly * 6 + empire.military.sea * 6;
    const enemyDef = attackTarget.nw * 0.0003;
    const success = myPower * (1 + (empire.race.stats?.offense || 0) / 100) > enemyDef;
    const tropsLost = Math.floor(empire.military.arm * (success ? 0.05 : 0.2));
    if (success) {
      const landStolen = Math.floor(Math.random() * 80 + 30);
      const goldPillaged = Math.floor(Math.random() * 30000 + 10000);
      onUpdate(prev => ({
        ...prev, turns: prev.turns - 5, gold: prev.gold + goldPillaged, land: prev.land + landStolen,
        military: { ...prev.military, arm: Math.max(0, prev.military.arm - tropsLost) },
        networth: prev.networth + goldPillaged + landStolen * 200,
      }));
      showTurnEffect("victory", "VICTORY!", `${attackTarget.name} lies in ruins.`, `+${goldPillaged.toLocaleString()} gold  +${landStolen} acres`);
      addLog(` Victorious assault on ${attackTarget.name}! +${goldPillaged.toLocaleString()} gold, +${landStolen} acres.`);
      flash("#d4a853", true);
    } else {
      onUpdate(prev => ({ ...prev, turns: prev.turns - 5, military: { ...prev.military, arm: Math.max(0, prev.military.arm - tropsLost) }, health: Math.max(10, prev.health - 15) }));
      showTurnEffect("defeat", "DEFEATED!", `${attackTarget.name} repelled your assault.`, `Lost ${tropsLost} Footmen  -15 health`);
      addLog(` Failed assault on ${attackTarget.name}. Lost ${tropsLost} Footmen.`);
      flash("#c0392b", true);
    }
  };

  const doCastSpell = (spell) => {
    if (empire.mana < spell.cost) { addToast(" Insufficient mana!", "error"); return; }
    if (empire.turns < 2) { addToast(" Not enough turns!", "error"); return; }
    const success = Math.random() > 0.25;
    if (success) {
      let extraUpdate = {}, gain = "Spell succeeded!";
      if (spell.id === "runes") { extraUpdate.mana = empire.mana - spell.cost + 300; gain = "+300 mana"; }
      else if (spell.id === "food") { extraUpdate.food = empire.food + 5000; gain = "+5,000 food"; }
      else if (spell.id === "cash") { extraUpdate.gold = empire.gold - spell.cost + 20000; gain = "+20,000 gold"; }
      else if (spell.id === "steal") { extraUpdate.gold = empire.gold - spell.cost + 15000; gain = "+15,000 stolen gold"; }
      else if (spell.id === "spy") { gain = `NW: ${attackTarget?.nw?.toLocaleString()}`; }
      onUpdate(prev => ({ ...prev, turns: prev.turns - 2, mana: prev.mana - spell.cost, ...extraUpdate }));
      showTurnEffect("spell", `${spell.name}!`, "Arcane energies surge through the realm.", gain);
      addLog(` Cast ${spell.name} successfully.`);
      flash("#9b59b6");
    } else {
      onUpdate(prev => ({ ...prev, turns: prev.turns - 2, mana: prev.mana - Math.floor(spell.cost * 0.5) }));
      showTurnEffect("spell", "Spell Fizzled!", "The arcane forces slip beyond your grasp.", `-${Math.floor(spell.cost * 0.5)} mana wasted`);
      addLog(` ${spell.name} fizzled.`);
    }
  };

  const TABS = [
    { id: "overview", label: "Overview", icon: "" },
    { id: "explore", label: "Explore", icon: "" },
    { id: "economy", label: "Economy", icon: "" },
    { id: "military", label: "Military", icon: "" },
    { id: "magic", label: "Magic", icon: "" },
    { id: "scores", label: "Rankings", icon: "" },
    { id: "log", label: "Chronicles", icon: "" },
  ];

  const totalMil = Object.values(empire.military).reduce((a, b) => a + b, 0);
  const totalBld = Object.values(empire.buildings).reduce((a, b) => a + b, 0);

  return (
    <div style={{ animation: shaking ? "shake 0.5s" : "none" }}>
      {flashColor && <ScreenFlash active color={flashColor} />}
      <TurnEffect effect={turnEffect} onComplete={() => setTurnEffect(null)} />

      {/* Sticky header */}
      <div style={{
        position: "sticky", top: 0, zIndex: 100,
        background: "linear-gradient(180deg, rgba(5,2,16,0.99) 0%, rgba(5,2,16,0.94) 100%)",
        backdropFilter: "blur(12px)", borderBottom: "1px solid rgba(212,168,83,0.12)",
        boxShadow: "0 4px 40px rgba(0,0,0,0.8)",
      }}>
        {/* Empire bar */}
        <div style={{ display: "flex", alignItems: "center", justifyContent: "space-between", padding: "8px 18px" }}>
          <div style={{ display: "flex", alignItems: "center", gap: 10 }}>
            <span style={{ fontSize: 20, filter: `drop-shadow(0 0 6px ${empire.race.color})` }}>{empire.race.emoji}</span>
            <div>
              <div style={{ fontFamily: "'Cinzel', serif", fontSize: 13, color: "#e8d5a3" }}>{empire.name}</div>
              <div style={{ fontSize: 10, color: empire.race.color, fontFamily: "'Cinzel', serif", letterSpacing: 2 }}>{empire.race.name}  Rank #{empire.rank}</div>
            </div>
          </div>
          <div style={{ display: "flex", gap: 16, flexWrap: "wrap" }}>
            {[
              { icon: "", val: empire.turns, label: "Turns", color: "#27ae60" },
              { icon: "", val: empire.gold.toLocaleString(), label: "Gold", color: "#f1c40f" },
              { icon: "", val: empire.food.toLocaleString(), label: "Food", color: "#27ae60" },
              { icon: "", val: empire.mana, label: "Mana", color: "#9b59b6" },
              { icon: "", val: empire.land, label: "Acres", color: "#3498db" },
              { icon: "", val: empire.networth.toLocaleString(), label: "NW", color: "#d4a853" },
            ].map(s => (
              <div key={s.label} style={{ textAlign: "center" }}>
                <div style={{ fontSize: 11, color: s.color, fontFamily: "'Cinzel', serif" }}>{s.icon} {s.val}</div>
                <div style={{ fontSize: 9, color: "#333", letterSpacing: 1 }}>{s.label}</div>
              </div>
            ))}
          </div>
        </div>

        {/* Health */}
        <div style={{ padding: "0 18px 6px" }}>
          <StatBar label="Empire Health" value={empire.health} max={100}
            color={empire.health > 60 ? "#27ae60" : empire.health > 30 ? "#f39c12" : "#e74c3c"} icon="" />
        </div>

        {/* Tabs */}
        <div style={{ display: "flex", gap: 0, padding: "0 14px", overflowX: "auto" }}>
          {TABS.map(t => (
            <button key={t.id} onClick={() => setActiveTab(t.id)} style={{
              background: activeTab === t.id ? "rgba(212,168,83,0.1)" : "transparent",
              border: "none", borderBottom: activeTab === t.id ? "2px solid #d4a853" : "2px solid transparent",
              color: activeTab === t.id ? "#d4a853" : "#444",
              padding: "9px 13px", cursor: "pointer", fontFamily: "'Cinzel', serif", fontSize: 11,
              whiteSpace: "nowrap", transition: "all 0.2s",
              textShadow: activeTab === t.id ? "0 0 10px #d4a85366" : "none",
            }}>{t.icon} {t.label}</button>
          ))}
        </div>
      </div>

      {/* Tab content */}
      <div style={{ maxWidth: 1100, margin: "0 auto", padding: "20px 14px 80px", position: "relative", zIndex: 1 }}>

        {/* OVERVIEW */}
        {activeTab === "overview" && (
          <div style={{ display: "grid", gridTemplateColumns: "repeat(auto-fit, minmax(240px, 1fr))", gap: 14 }}>
            <Panel title="Resources" icon="" glow="#d4a853">
              <StatBar label="Gold" value={empire.gold} max={500000} color="#f1c40f" icon="" />
              <StatBar label="Food" value={empire.food} max={200000} color="#27ae60" icon="" />
              <StatBar label="Mana" value={empire.mana} max={5000} color="#9b59b6" icon="" />
              <StatBar label="Turns" value={empire.turns} max={150} color="#27ae60" icon="" />
              <StatBar label="Population" value={empire.population} max={50000} color="#3498db" icon="" />
            </Panel>
            <Panel title="Territory" icon="" glow="#3498db">
              <div style={{ textAlign: "center", marginBottom: 14 }}>
                <div style={{ fontSize: 38, fontFamily: "'Cinzel', serif", color: "#3498db", textShadow: "0 0 20px #3498db88" }}>{empire.land}</div>
                <div style={{ color: "#333", fontSize: 11, letterSpacing: 2 }}>TOTAL ACRES</div>
              </div>
              <div style={{ color: "#555", fontSize: 11, display: "grid", gridTemplateColumns: "1fr 1fr", gap: 5 }}>
                {BUILDINGS.map(b => <span key={b.id}>{b.icon} {empire.buildings[b.id]} {b.name.split(" ")[0]}</span>)}
              </div>
              <div style={{ marginTop: 10, color: "#444", fontSize: 11 }}> {totalBld}/{empire.land} used  {empire.land - totalBld} free</div>
            </Panel>
            <Panel title="Military" icon="" glow="#e74c3c">
              {UNITS.map(u => (
                <div key={u.id} style={{ display: "flex", justifyContent: "space-between", marginBottom: 8, padding: "5px 8px", background: "rgba(255,255,255,0.015)", borderRadius: 4 }}>
                  <span style={{ color: "#888", fontSize: 12 }}>{u.icon} {u.name}</span>
                  <span style={{ color: "#e74c3c", fontFamily: "'Cinzel', serif" }}>{empire.military[u.id].toLocaleString()}</span>
                </div>
              ))}
              <div style={{ borderTop: "1px solid rgba(255,255,255,0.05)", paddingTop: 8, color: "#555", fontSize: 11 }}>
                Total: <span style={{ color: "#e74c3c" }}>{totalMil.toLocaleString()}</span>
              </div>
            </Panel>
            <Panel title="Quick Actions" icon="" glow="#27ae60">
              <div style={{ display: "flex", flexDirection: "column", gap: 9 }}>
                <GlowButton onClick={() => setActiveTab("explore")} color="#3498db" small> Explore Territory</GlowButton>
                <GlowButton onClick={() => { setTurnsToUse(5); doCollectTax(); }} color="#f1c40f" small> Collect Taxes</GlowButton>
                <GlowButton onClick={() => { setTurnsToUse(5); doFarm(); }} color="#27ae60" small> Harvest Fields</GlowButton>
                <GlowButton onClick={() => setActiveTab("military")} color="#e74c3c" small> Manage Military</GlowButton>
                <GlowButton onClick={() => setActiveTab("magic")} color="#9b59b6" small> Cast Spells</GlowButton>
              </div>
            </Panel>
          </div>
        )}

        {/* EXPLORE */}
        {activeTab === "explore" && (
          <Panel title="Territorial Expansion" icon="" glow="#3498db">
            <div style={{ maxWidth: 500, margin: "0 auto" }}>
              <p style={{ color: "#777", marginBottom: 22, lineHeight: 1.7, fontSize: 13 }}>
                Send your scouts into the wilderness. Each turn spent pushes your borders outward, claiming unclaimed land for the crown.
              </p>
              <div style={{ marginBottom: 20 }}>
                <label style={{ display: "block", color: "#a07850", fontSize: 10, fontFamily: "'Cinzel', serif", letterSpacing: 2, marginBottom: 12, textTransform: "uppercase" }}>
                  TURNS TO SPEND: <span style={{ color: "#d4a853", fontSize: 18 }}>{turnsToUse}</span>
                </label>
                <input type="range" min={1} max={Math.min(empire.turns, 50)} value={turnsToUse}
                  onChange={e => setTurnsToUse(Number(e.target.value))}
                  style={{ width: "100%", accentColor: "#3498db", cursor: "pointer" }} />
                <div style={{ display: "flex", justifyContent: "space-between", color: "#444", fontSize: 11, marginTop: 4 }}>
                  <span>~{turnsToUse * 3} acres min</span><span>~{turnsToUse * 7} acres max</span>
                </div>
              </div>
              <div style={{ background: "rgba(52,152,219,0.05)", borderRadius: 8, padding: 14, marginBottom: 18, border: "1px solid rgba(52,152,219,0.12)" }}>
                <div style={{ color: "#777", fontSize: 12 }}>Cost: <span style={{ color: "#f1c40f" }}>{(turnsToUse * 750).toLocaleString()} gold</span></div>
                <div style={{ color: "#777", fontSize: 12, marginTop: 4 }}>Yield: <span style={{ color: "#3498db" }}>{turnsToUse * 3}{turnsToUse * 7} acres</span></div>
              </div>
              <GlowButton onClick={doExplore} color="#3498db"
                disabled={empire.turns < turnsToUse || empire.gold < turnsToUse * 750} pulse>
                 &nbsp; Launch Expedition &nbsp; ({turnsToUse} turns)
              </GlowButton>
            </div>
          </Panel>
        )}

        {/* ECONOMY */}
        {activeTab === "economy" && (
          <div style={{ display: "grid", gap: 14 }}>
            <Panel title="Economic Actions" icon="" glow="#f1c40f">
              <div style={{ marginBottom: 16 }}>
                <label style={{ color: "#a07850", fontSize: 10, fontFamily: "'Cinzel', serif", letterSpacing: 2, display: "block", marginBottom: 10, textTransform: "uppercase" }}>
                  TURNS TO SPEND: <span style={{ color: "#d4a853", fontSize: 16 }}>{turnsToUse}</span>
                </label>
                <input type="range" min={1} max={Math.min(empire.turns, 50)} value={turnsToUse}
                  onChange={e => setTurnsToUse(Number(e.target.value))}
                  style={{ width: "100%", accentColor: "#f1c40f", cursor: "pointer" }} />
              </div>
              <div style={{ display: "flex", gap: 10, flexWrap: "wrap" }}>
                <GlowButton onClick={doCollectTax} color="#f1c40f" disabled={empire.turns < turnsToUse}>
                   Collect Taxes (~{(turnsToUse * empire.buildings.cash * 850).toLocaleString()} gold)
                </GlowButton>
                <GlowButton onClick={doFarm} color="#27ae60" disabled={empire.turns < turnsToUse}>
                   Harvest (~{(turnsToUse * empire.buildings.food * 120).toLocaleString()} food)
                </GlowButton>
              </div>
            </Panel>
            <Panel title="Construction" icon="" glow="#e67e22">
              <div style={{ color: "#555", fontSize: 12, marginBottom: 14 }}>
                Land used: {totalBld}/{empire.land}  Free: {empire.land - totalBld} acres  Cost: 1,200 gold/building
              </div>
              <div style={{ display: "grid", gridTemplateColumns: "repeat(auto-fit, minmax(230px, 1fr))", gap: 10 }}>
                {BUILDINGS.map(b => (
                  <div key={b.id} style={{ padding: 12, background: "rgba(255,255,255,0.015)", borderRadius: 8, border: `1px solid ${b.color}18` }}>
                    <div style={{ display: "flex", justifyContent: "space-between", marginBottom: 6 }}>
                      <span style={{ color: b.color, fontSize: 12, fontFamily: "'Cinzel', serif" }}>{b.icon} {b.name}</span>
                      <span style={{ color: "#555", fontSize: 11 }}>{empire.buildings[b.id]}</span>
                    </div>
                    <p style={{ color: "#555", fontSize: 11, marginBottom: 8 }}>{b.desc}</p>
                    <div style={{ display: "flex", gap: 8, alignItems: "center" }}>
                      <input type="number" min={1} max={100} value={buildAmounts[b.id] || 1}
                        onChange={e => setBuildAmounts(p => ({ ...p, [b.id]: e.target.value }))}
                        style={{ width: 55, background: "rgba(255,255,255,0.05)", border: "1px solid rgba(255,255,255,0.08)", color: "#e8d5a3", padding: "3px 7px", borderRadius: 4, fontSize: 12 }} />
                      <GlowButton onClick={() => doBuild(b)} color={b.color} small
                        disabled={empire.gold < (parseInt(buildAmounts[b.id] || 1) * 1200) || totalBld >= empire.land}>
                        Build
                      </GlowButton>
                    </div>
                  </div>
                ))}
              </div>
            </Panel>
          </div>
        )}

        {/* MILITARY */}
        {activeTab === "military" && (
          <div style={{ display: "grid", gap: 14 }}>
            <Panel title="Recruit Forces" icon="" glow="#e74c3c">
              <div style={{ display: "grid", gridTemplateColumns: "repeat(auto-fit, minmax(230px, 1fr))", gap: 10 }}>
                {UNITS.map(u => (
                  <div key={u.id} style={{ padding: 14, background: "rgba(231,76,60,0.03)", borderRadius: 8, border: "1px solid rgba(231,76,60,0.12)" }}>
                    <div style={{ fontSize: 20, marginBottom: 6, filter: "drop-shadow(0 0 5px #e74c3c)" }}>{u.icon}</div>
                    <div style={{ color: "#e8d5a3", fontFamily: "'Cinzel', serif", fontSize: 12, marginBottom: 3 }}>{u.name}</div>
                    <p style={{ color: "#555", fontSize: 11, marginBottom: 6 }}>{u.desc}</p>
                    <div style={{ color: "#666", fontSize: 10, marginBottom: 8 }}>
                       {u.offense}   {u.defense}   {u.cost.toLocaleString()} gold
                    </div>
                    <div style={{ color: "#555", fontSize: 10, marginBottom: 8 }}>
                      Current: <span style={{ color: "#e74c3c" }}>{empire.military[u.id].toLocaleString()}</span>
                    </div>
                    <div style={{ display: "flex", gap: 8, alignItems: "center" }}>
                      <input type="number" min={1} max={1000} value={recruitAmounts[u.id] || 1}
                        onChange={e => setRecruitAmounts(p => ({ ...p, [u.id]: e.target.value }))}
                        style={{ width: 60, background: "rgba(255,255,255,0.05)", border: "1px solid rgba(255,255,255,0.08)", color: "#e8d5a3", padding: "3px 7px", borderRadius: 4, fontSize: 12 }} />
                      <GlowButton onClick={() => doRecruit(u)} color="#e74c3c" small
                        disabled={empire.gold < (parseInt(recruitAmounts[u.id] || 1) * u.cost)}>
                        Recruit
                      </GlowButton>
                    </div>
                  </div>
                ))}
              </div>
            </Panel>
            <Panel title="Launch Attack" icon="" glow="#c0392b">
              <div style={{ marginBottom: 14 }}>
                <label style={{ color: "#a07850", fontSize: 10, fontFamily: "'Cinzel', serif", letterSpacing: 2, display: "block", marginBottom: 8, textTransform: "uppercase" }}>TARGET</label>
                <select value={attackTarget?.rank || ""} onChange={e => setAttackTarget(LEADERBOARD.find(l => l.rank === parseInt(e.target.value)))}
                  style={{ background: "rgba(13,5,32,0.9)", border: "1px solid rgba(231,76,60,0.25)", color: "#e8d5a3", padding: "7px 12px", borderRadius: 6, fontFamily: "'Cinzel', serif", fontSize: 12, width: "100%" }}>
                  {LEADERBOARD.map(e => <option key={e.rank} value={e.rank}>{e.name} ({e.race})  NW: {e.nw.toLocaleString()}</option>)}
                </select>
              </div>
              <GlowButton onClick={doAttack} color="#c0392b" disabled={empire.turns < 5} pulse>
                 &nbsp; Launch Assault &nbsp; (5 turns)
              </GlowButton>
            </Panel>
          </div>
        )}

        {/* MAGIC */}
        {activeTab === "magic" && (
          <div style={{ display: "grid", gridTemplateColumns: "repeat(auto-fit, minmax(240px, 1fr))", gap: 12 }}>
            {SPELLS.map(spell => (
              <div key={spell.id} style={{
                padding: 14, borderRadius: 10,
                background: `linear-gradient(135deg, ${spell.color}07, rgba(13,5,32,0.9))`,
                border: `1px solid ${spell.color}28`,
              }}>
                <div style={{ fontSize: 26, marginBottom: 7, filter: `drop-shadow(0 0 6px ${spell.color})` }}>{spell.icon}</div>
                <div style={{ fontFamily: "'Cinzel', serif", fontSize: 12, color: "#e8d5a3", marginBottom: 4 }}>{spell.name}</div>
                <p style={{ color: "#555", fontSize: 11, marginBottom: 9, lineHeight: 1.5 }}>{spell.desc}</p>
                <div style={{ fontSize: 11, marginBottom: 10, color: "#555" }}>
                  <span style={{ color: "#9b59b6" }}>{spell.cost} mana</span>  {spell.type === "self" ? "Self" : "Enemy"}
                </div>
                <GlowButton onClick={() => doCastSpell(spell)} color={spell.color}
                  disabled={empire.mana < spell.cost || empire.turns < 2} small>
                  {spell.icon} Cast
                </GlowButton>
              </div>
            ))}
          </div>
        )}

        {/* SCORES */}
        {activeTab === "scores" && (
          <Panel title="World Rankings" icon="" glow="#d4a853">
            <div style={{ overflowX: "auto" }}>
              <table style={{ width: "100%", borderCollapse: "collapse" }}>
                <thead><tr>
                  {["Rank", "Empire", "Race", "Networth", "Land", ""].map(h => (
                    <th key={h} style={{ color: "#444", fontFamily: "'Cinzel', serif", fontSize: 10, textAlign: "left", padding: "7px 10px", borderBottom: "1px solid rgba(212,168,83,0.1)", letterSpacing: 1 }}>{h}</th>
                  ))}
                </tr></thead>
                <tbody>
                  <tr style={{ background: "rgba(212,168,83,0.05)" }}>
                    <td style={{ padding: "9px 10px", color: "#d4a853", fontFamily: "'Cinzel', serif" }}>#{empire.rank}</td>
                    <td style={{ padding: "9px 10px", color: "#e8d5a3" }}> {empire.name} <span style={{ color: "#333" }}>(YOU)</span></td>
                    <td style={{ padding: "9px 10px", color: empire.race.color }}>{empire.race.emoji} {empire.race.name}</td>
                    <td style={{ padding: "9px 10px", color: "#f1c40f" }}>{empire.networth.toLocaleString()}</td>
                    <td style={{ padding: "9px 10px", color: "#3498db" }}>{empire.land}</td>
                    <td />
                  </tr>
                  {LEADERBOARD.map((e, i) => (
                    <tr key={e.rank} style={{ background: i % 2 === 0 ? "transparent" : "rgba(255,255,255,0.01)" }}>
                      <td style={{ padding: "9px 10px", color: e.rank <= 3 ? "#d4a853" : "#333", fontFamily: "'Cinzel', serif" }}>
                        {e.rank <= 3 ? ["","",""][e.rank-1] : `#${e.rank}`}
                      </td>
                      <td style={{ padding: "9px 10px", color: "#bbb", fontSize: 13 }}>{e.name}</td>
                      <td style={{ padding: "9px 10px", color: "#555", fontSize: 12 }}>{e.race}</td>
                      <td style={{ padding: "9px 10px", color: "#f1c40f", fontSize: 12 }}>{e.nw.toLocaleString()}</td>
                      <td style={{ padding: "9px 10px", color: "#3498db", fontSize: 12 }}>{e.land.toLocaleString()}</td>
                      <td style={{ padding: "9px 10px" }}>
                        <div style={{ display: "flex", gap: 5 }}>
                          <GlowButton small color="#e74c3c" onClick={() => { setAttackTarget(e); setActiveTab("military"); }}></GlowButton>
                          <GlowButton small color="#9b59b6" onClick={() => { setAttackTarget(e); setActiveTab("magic"); }}></GlowButton>
                        </div>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </Panel>
        )}

        {/* LOG */}
        {activeTab === "log" && (
          <Panel title="Chronicles of Your Reign" icon="" glow="#a07850">
            {empire.log.length === 0 ? (
              <p style={{ color: "#222", fontStyle: "italic", textAlign: "center", padding: 40 }}>Your story has yet to be written...</p>
            ) : (
              <div style={{ display: "flex", flexDirection: "column", gap: 7 }}>
                {empire.log.map((l, i) => (
                  <div key={i} style={{
                    display: "flex", gap: 10, padding: "8px 12px",
                    background: i === 0 ? "rgba(212,168,83,0.04)" : "rgba(255,255,255,0.015)",
                    borderRadius: 6, borderLeft: `2px solid ${i === 0 ? "#d4a853" : "rgba(212,168,83,0.15)"}`,
                    animation: i === 0 ? "slideIn 0.4s ease" : "none",
                  }}>
                    <span style={{ color: "#333", fontSize: 10, whiteSpace: "nowrap", paddingTop: 2 }}>{l.time}</span>
                    <span style={{ color: "#999", fontSize: 13 }}>{l.text}</span>
                  </div>
                ))}
              </div>
            )}
          </Panel>
        )}
      </div>

      {/* Toasts */}
      <div style={{ position: "fixed", bottom: 20, right: 20, display: "flex", flexDirection: "column", gap: 7, zIndex: 1000, maxWidth: 360 }}>
        {toasts.map(t => <Toast key={t.id} message={t.message} type={t.type} />)}
      </div>
    </div>
  );
}

// ============================================================
// APP ROOT
// ============================================================
export default function App() {
  const [screen, setScreen] = useState("intro");
  const [empire, setEmpire] = useState(null);

  const handleStart = () => setScreen("create");
  const handleCreate = (name, race) => {
    setEmpire({ ...INITIAL_STATE, name, race, log: [{ text: `The ${race.name} empire of ${name} rises from the ashes of history.`, time: new Date().toLocaleTimeString() }] });
    setScreen("game");
  };

  const handleUpdate = useCallback((updater) => {
    setEmpire(prev => { if (!prev) return prev; return typeof updater === "function" ? updater(prev) : { ...prev, ...updater }; });
  }, []);

  const hasEmpire = empire !== null;
  useEffect(() => {
    if (!hasEmpire) return;
    const turnTimer = setInterval(() => setEmpire(prev => prev ? { ...prev, turns: Math.min(prev.turns + 1, 150) } : prev), 30000);
    const manaTimer = setInterval(() => setEmpire(prev => prev ? { ...prev, mana: Math.min(prev.mana + Math.max(5, prev.buildings.wiz * 2), 5000) } : prev), 10000);
    return () => { clearInterval(turnTimer); clearInterval(manaTimer); };
  }, [hasEmpire]);

  return (
    <div style={{ minHeight: "100vh", background: "radial-gradient(ellipse at 50% 0%, #12052a 0%, #0a0318 25%, #040110 60%, #010008 100%)", color: "#e8d5a3", fontFamily: "'Spectral', serif" }}>
      <style>{`
        @import url('https://fonts.googleapis.com/css2?family=Cinzel:wght@400;600;900&family=Cinzel+Decorative:wght@400;700;900&family=Spectral:ital,wght@0,300;0,400;1,300&display=swap');
        @keyframes slideIn { from { opacity:0; transform:translateX(-10px); } to { opacity:1; transform:translateX(0); } }
        @keyframes fadeUp { from { opacity:0; transform:translateY(30px); } to { opacity:1; transform:translateY(0); } }
        @keyframes torchFlicker { 0% { transform:scaleX(1) rotate(-2deg); opacity:0.88; } 100% { transform:scaleX(1.1) scaleY(1.05) rotate(2deg); opacity:1; } }
        @keyframes beamSweep { 0%,100% { opacity:0.3; transform:scaleX(0.7); } 50% { opacity:0.9; transform:scaleX(1.3); } }
        @keyframes pulseGlow { 0%,100% { box-shadow:0 0 8px #d4a85333; } 50% { box-shadow:0 0 25px #d4a85377, 0 0 50px #d4a85322; } }
        @keyframes shake { 0%,100%{transform:translateX(0);} 20%{transform:translateX(-8px);} 40%{transform:translateX(8px);} 60%{transform:translateX(-5px);} 80%{transform:translateX(5px);} }
        @keyframes screenFlash { 0%{opacity:1;} 100%{opacity:0;} }
        @keyframes toastIn { from{opacity:0;transform:translateX(30px);} to{opacity:1;transform:translateX(0);} }
        @keyframes shimmer { 0%,100%{opacity:0.3;} 50%{opacity:0.8;} }
        @keyframes emojiFloat { 0%,100%{transform:translateY(0);} 50%{transform:translateY(-5px);} }
        @keyframes iconPop { 0%{transform:scale(0.5);opacity:0;} 60%{transform:scale(1.2);} 100%{transform:scale(1);opacity:1;} }
        @keyframes gainPop { 0%{opacity:0;transform:scale(0.8) translateY(10px);} 100%{opacity:1;transform:scale(1) translateY(0);} }
        @keyframes scanLine { 0%{opacity:0;transform:scaleX(0);} 50%{opacity:1;} 100%{opacity:0;transform:scaleX(1);} }
        @keyframes floatParticle0 { 0%{opacity:1;transform:translate(0,0);} 100%{opacity:0;transform:translate(-80px,-120px);} }
        @keyframes floatParticle1 { 0%{opacity:1;transform:translate(0,0);} 100%{opacity:0;transform:translate(90px,-100px);} }
        @keyframes floatParticle2 { 0%{opacity:1;transform:translate(0,0);} 100%{opacity:0;transform:translate(-60px,-140px);} }
        @keyframes floatParticle3 { 0%{opacity:1;transform:translate(0,0);} 100%{opacity:0;transform:translate(70px,-110px);} }
        * { box-sizing:border-box; margin:0; padding:0; }
        body { overflow-x:hidden; }
        input[type=range] { -webkit-appearance:none; height:3px; background:rgba(255,255,255,0.08); border-radius:2px; outline:none; }
        input[type=range]::-webkit-slider-thumb { -webkit-appearance:none; width:14px; height:14px; border-radius:50%; cursor:pointer; background:#d4a853; }
        ::-webkit-scrollbar { width:4px; } ::-webkit-scrollbar-track { background:#04010e; } ::-webkit-scrollbar-thumb { background:#d4a85322; border-radius:2px; }
        select option { background:#090218; }
        input[type=number]::-webkit-inner-spin-button { opacity:0.3; }
      `}</style>
      <ParticleField intensity={screen === "game" ? 0.4 : 1} />
      {screen !== "game" && <Torch side="left" />}
      {screen !== "game" && <Torch side="right" />}
      {screen === "intro" && <IntroScreen onStart={handleStart} />}
      {screen === "create" && <CharacterCreation onComplete={handleCreate} />}
      {screen === "game" && empire && <GameScreen empire={empire} onUpdate={handleUpdate} />}
    </div>
  );
}
